import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';

import {
  clickedPaymentButton,
  clickedProfileButton,
} from '../../actions/dashboardAction';

class AllProfile extends Component {
  state = {
    dashboardMenu: '1',
  };

  renderButton = (key) => {
    this.setState({ dashboardMenu: key });
    console.log(key);
    console.log(this.state);
  };

  render() {
    return (
      <div>
        <button
          key='1'
          onClick={this.renderButton}
          className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full mb-3'>
          Profile
        </button>
        <button
          key='2'
          onClick={this.renderButton}
          className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full'>
          Payment Details
        </button>
      </div>
    );
  }
}

export default connect(null, {
  clickedPaymentButton,
  clickedProfileButton,
})(AllProfile);
